import { Grid } from "semantic-ui-react";
import Filter from "./Filter";
import "./Backpack.css";

class Backpack extends Component {
  render() {
    return (
      <div className="container">
        <Grid
          celled
          divided
          style={{ overflow: "auto", minHeight: "700px" }}
          columns={3}
        >
          <Grid.Row>
            <h2 className="subtitle_center">Select PU from dropdown lists</h2>
          </Grid.Row>
          <Grid.Row>
            <Grid>
              <Grid.Column>
                <Filter />
              </Grid.Column>
              <Grid.Column>
                <Filter />
              </Grid.Column>
              <Grid.Column>
                <Filter />
              </Grid.Column>
            </Grid>
          </Grid.Row>
        </Grid>
      </div>
    );
  }
}

export default Backpack;
